		this.vol_dwn.addEventListener("click", volDwn.bind(this));
		this.vol_up.addEventListener("click", volUp.bind(this));
		this.vol_mute.addEventListener("click", voMute.bind(this));
		this.btn_musOn.addEventListener("click", musMute.bind(this));
		this.btn_musOff.addEventListener("click", musMute.bind(this));

		this.btn_goNext.addEventListener("click", openNext.bind(this));
		this.btn_goBack.addEventListener("click", openPrev.bind(this));

		//var vo = createjs.Sound.play('VO');

		var vo_mute = false;

		var prev_vol = bgm.volume;

		function openMenu(){
		 window.open ("../menu/main_menu.html","_self");
		}
		*/
		//audio functions -----------------------------------------

		{	
			if(!vo_mute){
				createjs.Sound.volume = createjs.Sound.volume -0.05;
			}
			if(!mus_mute){
				bgm.volume -= 0.05;
				prev_vol = bgm.volume;
			}
			console.log(bgm.volume);
			console.log(prev_vol);
		}
		function volUp()
		{
			if(!vo_mute){
				createjs.Sound.volume = createjs.Sound.volume +0.05;
			}
			if(!mus_mute){
				bgm.volume += 0.05;
				prev_vol = bgm.volume;
			}
			console.log(bgm.volume);
			console.log(prev_vol);
		}
		function musMute()
		{
			if(!mus_mute){
				mus_mute = true
				bgm.volume = 0;
				this.btn_musOn.visible = false;
				this.btn_musOff.visible = true;
			}
			else{
				mus_mute = false;
				bgm.volume = prev_vol;
				this.btn_musOn.visible = true;
				this.btn_musOff.visible = false;
			}
			console.log(mus_mute);
		}
		function voMute()
		{
			if(!vo_mute){
				vo_mute = true
				createjs.Sound.muted = true;
			}
			else{
				vo_mute = false;
				createjs.Sound.muted = false;
			}
			console.log(vo_mute);
